import React from 'react';
import RegisterForm from './RegisterForm';
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';
import { GoogleLoginButton, FacebookLoginButton } from 'react-social-login-buttons'; // Assuming you have a library for social sign-in buttons
import './Register.css'; // Import custom CSS for additional styling

function Register() {
  return (
    <div className="register-container">
      <h2 className="register-heading">Create an Account</h2>
      <RegisterForm />
      <div className="button-container">
        <Button component={Link} to="/login" variant="contained" color="primary" size="large">
          Login
        </Button>
        <Button component={Link} to="/forgot-password" variant="text" color="primary">
          Forgot Password
        </Button>
      </div>
      <div className="social-signin-container">
        <GoogleLoginButton onClick={() => handleGoogleSignIn()} />
        <FacebookLoginButton onClick={() => handleFacebookSignIn()} />
      </div>
    </div>
  );
}

export default Register;
